<!DOCTYPE html>
    <html lang="pt-BR">
    <head>
        <meta charset="UTF-8"/>
        <title>Recibo</title>
        <style>
            @page {
                size: A4;
                margin: 10mm;
            }

            body {
                font-family: Arial, sans-serif;
                margin: 0;
                padding: 0;
            }

            .recibo-container {
                display: flex;
                justify-content: space-between;
                gap: 10mm;
                margin: 10mm auto;
                margin-top: 0;
                max-width: 200mm; /* largura útil dentro de uma A4 com margens */
            }

            .recibo {
                width: auto; /* cerca de metade da largura útil */
                border: 2px solid #000;
                border-radius: 3mm;
                padding: 10mm;
                box-sizing: border-box;
            }

            .recibo-container img {
                width: 100%;
            }

            .cabecalho {
                margin-bottom: 5mm;
            }

            h2 {
                text-align: center;
                font-size: 18pt;
            }

            p {
                text-align: justify;
                font-size: 12pt;
                line-height: 1.5;
                margin: 1mm 0;
            }

            hr {
                border: 1px solid #000;
                margin: 0;
            }
        </style>
    </head>
